import FreeSimpleGUI as sg
from math import floor

small=False

bg_brown="#332b26"
bg_blue = "#36554E"#"darkblue"
numbers_colour="yellow"
paused_numbers = bg_blue

my_new_theme = {'BACKGROUND': bg_brown,
                'TEXT': "#ffd768",
                'INPUT': "#45523F",
                'TEXT_INPUT': "#f5db74",
                'SCROLL': "#003e9b",
                'BUTTON': ('black', "#F8DC5E"),
                'PROGRESS': ('#01826B', '#D0D0D0'),
                'BORDER': 3,
                'SLIDER_DEPTH': 0,
                'PROGRESS_DEPTH': 0}

# Add your dictionary to the PySimpleGUI themes
sg.theme_add_new('MyNewTheme', my_new_theme)

# Switch your theme to use the newly added one. You can add spaces to make it more readable
sg.theme('My New Theme')



def make_window(small, total_sec):

    if small:
        std_dot_size=8
        widest_measure = 170
        half_measure = (widest_measure/2)-5
        std_btn = 7
        num_pad_w = 10
        num_pad_h = 4
        numbers_size = 20
        border_lg = 3
        five = 2
        two = 0
        size_text="std"
        small_hide=True
        tooltip_str="Press to change to standard version"
        restart_str="Restart"
        pause_str="Paused"

    else:
        std_dot_size=10
        widest_measure = 340
        half_measure = (widest_measure/2)-5
        std_btn = 10
        num_pad_w = 20
        num_pad_h = 8
        numbers_size = 40
        border_lg = 6
        five = 5
        two = 2
        size_text="small"
        small_hide=False
        tooltip_str="Press to change to small version"
        restart_str="[Restart]"
        pause_str="[Paused]"

    def counter_func(total_seconds):
        minutes = (floor(total_seconds / 60))
        sec = total_seconds - (minutes * 60)
        if len(str((round(sec)))) < 2:
            sec = "0" + str(round(sec))
        else:
            sec=round(sec)
        return str(minutes), str(sec)

    print(f"incoming total sec: {total_sec}")
    minute, sec = counter_func(total_sec)
    print(f"input default min { minute}, sec: {sec}")
    input_default = str(minute) + "." + str(sec)


    def parse_inputtext(input_text:str):
        split_text=None
        minute = "00"
        sec = "00"
        separators = (":", ".", " ",)

        if len(input_text) > 2:
            for x in separators:
                if x in input_text:
                    split_text=input_text.split(x)

        if len(input_text) <= 2:
            minute = input_text
        elif split_text and len(split_text) == 2:
                minute=split_text[0]
                sec = split_text[1]

        return minute, sec

    icon_str = b''

    def pause_toggle(window, paused=False, running=True, pauseblink_invis=False): # paused is a bool, represents existing state, not desired state. Returns the new paused state.

        if running:
            running = False
            pause_blink(window, pauseblink_invis=False, new_text=pause_str)
            paused=True
            pauseblink_invis=False

        else:
            running = True
            pause_blink(window, pauseblink_invis=True, new_text="Pause")
            paused=False
            pauseblink_invis=False

        return pauseblink_invis, paused, running

    def pause_blink(window, pauseblink_invis, new_text=None):
        if pauseblink_invis:
            new_colour = numbers_colour
            pauseblink_invis=False
        else:
            new_colour = paused_numbers
            pauseblink_invis=True
        window['minutes'].update(text_color=new_colour)
        window['seconds'].update(text_color=new_colour)
        if new_text and new_text is not None:
            window['-PAUSE-'].update(new_text)
        return pauseblink_invis

    def counter_text(key_str="minutes", txt_col=numbers_colour, val=str("00")):
        counting_font=f'segoe {numbers_size} bold'
        return sg.Text(text=val, key=key_str, size=(3,1), background_color=bg_blue, relief="sunken", border_width=border_lg, justification="center", font=counting_font, text_color=txt_col, pad=(num_pad_w, num_pad_h))

    def make_button(width:float=std_btn, height:float=std_btn, key_str:str="Pause"):
            key_upper = key_str.upper()
            key_formatting = str("-" + key_upper + '-')
            return sg.Button(key_str, key=key_formatting, size=(width,height), font=(f"courier {std_dot_size} bold"))

    def make_spacer(width:float=0, height:float=0):
        return sg.Canvas(size=(width, height), background_color="purple")

    def add_dots(dot_size=std_dot_size):

        dot_instance = sg.Text('', font=(f"courier {dot_size} bold"), auto_size_text=True, pad=0, justification="centre")
        return dot_instance

    def make_vert_dots(size1=std_dot_size, size2=std_dot_size, size3=std_dot_size):
        if small:
            vert_dots_layout = [[add_dots(size1)], [add_dots(size2)]]
        else:
            vert_dots_layout = [[add_dots(size1)], [add_dots(size2)], [add_dots(size3)]]
        return vert_dots_layout

    def make_horz_dots(size1=std_dot_size, size2=std_dot_size, size3=std_dot_size):
        if small:
            horz_dots_layout = [[add_dots(size1), add_dots(size2)]]
        else:
            horz_dots_layout = [[add_dots(size1), add_dots(size2), add_dots(size3)]]
        return horz_dots_layout

    def mid_gap():
        mid_dots = [[add_dots(std_dot_size)], [add_dots(std_dot_size)]]
        return mid_dots

    numbers = [[counter_text("minutes", None, minute),
                sg.Column(layout=mid_gap()),
                counter_text("seconds", None, sec),
                  ]]

    column_one_vert = [[sg.HSeparator(color="gold"), add_dots(), sg.Button(size_text, tooltip=tooltip_str, size=(5,1), font="courier 8", )],
                       [sg.Canvas(size=(widest_measure,two), visible=small_hide)],
                    [sg.Column(layout=make_vert_dots(size1=std_dot_size, size2=int(std_dot_size)+2, size3=int(std_dot_size)+4), vertical_alignment="center"),
                     sg.Column(layout=numbers, justification="c", vertical_alignment="center"),
                     sg.Column(layout=make_vert_dots(size1=std_dot_size, size2=int(std_dot_size)+2, size3=int(std_dot_size)+4), vertical_alignment="center")]]

    column_two_vert = [[sg.Canvas(size=(widest_measure,two), pad=two, visible=small_hide)],
                    [sg.HSeparator(color="gold")],
                    [sg.Canvas(size=(widest_measure,five), visible=small_hide)],

                    [sg.Stretch(),
                     sg.Column(layout=make_horz_dots(size1=std_dot_size, size2=int(std_dot_size)+2, size3=int(std_dot_size)+4), pad=0),
                     sg.Text('', font=(f"courier {int(std_dot_size) + 4} bold"), pad=0),
                     sg.InputText(default_text=input_default, size=(int(std_dot_size)+6, int(std_dot_size)*2), border_width=two, focus=False, enable_events=True, justification="c", font=("courier", std_dot_size, "bold"),
                        key='-INPUT-', tooltip="Input styles: \n     min.sec (15.10), \n     min:sec (15:10), \n     15m10s, \n     15m, \n     10s, \n     15 (defaults to minutes if not specified.)"),
                        sg.Text('', font=(int(std_dot_size) + 4)),
                        sg.Column(layout=make_horz_dots(size1=int(std_dot_size)+4, size2=int(std_dot_size)+2, size3=std_dot_size)),
                        sg.Stretch()],

                    [sg.VStretch()],
                    [sg.Stretch(), make_button(width=std_btn, height=1, key_str="Start"), sg.Stretch(), make_button(width=std_btn, height=1, key_str="Pause"), sg.Stretch(), make_button(width=std_btn, height=1, key_str="Exit"), sg.Stretch()],
                    [add_dots(), sg.Canvas(size=(half_measure,two), pad=two), sg.Stretch(), add_dots(), sg.Stretch(), sg.Canvas(size=(half_measure,two), pad=two), add_dots()]]

    main_contents_vert = [
            [sg.Column(layout=column_one_vert, justification="center")], [sg.Column(layout=column_two_vert, justification="center")]
        ]


    layout = [[sg.Frame(title="timer ", layout=main_contents_vert, font=("courier", std_dot_size, "bold"), relief="groove", pad=((0, 0),(0,five)))]]

    # Create the Window
    minute = sec = 00
    running=False
    paused=False
    pauseblink_invis=False
    window = sg.Window('Timer Standard', layout, keep_on_top=True, finalize=True, alpha_channel=.85, grab_anywhere=True, use_custom_titlebar=True, titlebar_background_color="#332b26", titlebar_text_color="#ffd768", titlebar_font="courier 10 bold", icon=icon_str, )
    window['-INPUT-'].bind("<Return>", "_Enter")
    while True:
        event, values = window.read(timeout=1000)
        if event == "-START-" or event == "-INPUT-" + "_Enter":
            if paused:
                pauseblink_invis, paused, running = pause_toggle(window, paused, running=False) # need to toggle the pause here so it doesn't stop the start button working.
            else:
                running=True
            input_text: str = values['-INPUT-']
            if input_text:
                minute, sec = parse_inputtext(input_text)
                print(f"Minute: {minute}, sec: {sec}")
                print("Starting clock...")
                total_sec = (float(minute) * 60) + float(sec)

                window['minutes'].update(minute)
                window['seconds'].update(sec)
                window['-START-'].update(restart_str)
                # I really want to animate it opening its eyes when the timer's about to start.
            else:
                print("Please enter a number")

        if event == size_text:
            small=not small
            window.close()
            return small, total_sec

        if event == sg.WIN_CLOSED or event == '-EXIT-':
            running=False
            break

        if total_sec < 0:
            running = False

        if event == "-PAUSE-":
            pauseblink_invis, paused, running = pause_toggle(window, paused, running, pauseblink_invis) # invis is always starting from False regardless of actual status here.

        if paused:
            pauseblink_invis = pause_blink(window, pauseblink_invis)

        if running:
            minutes, seconds = counter_func(total_sec)
            window['minutes'].update(minutes)
            window['seconds'].update(seconds)
            total_sec -= 1
            window.finalize()
            if total_sec < 0:
                running=False

    window.close()
    return "exit", None


def manage_window():

    small=False
    total_sec=float(300)
    while True:
        small, total_sec = make_window(small, total_sec)
        if small=="exit":
            break



if __name__ == '__main__':

    manage_window()
